XXX Xxxxxxxxxxxx is the construction JV of the Red River Valley Alliance (RRVA). RRVA was chosen as the developer by the Metro Flood Diversion Authority for the design, construction, financing and maintenance of the Fargo-Moorhead Area Diversion Channel for a period of 29 years. XXX Xxxxxxxxxxxx, a joint venture of three international contractors (Acciona, Shikun & Binui and North American Construction Group), will work with the Metro Flood Diversion Authority and other area stakeholders to build a historic project that will protect the citizens of the Fargo-Moorhead area from flood waters from the Red River.

Policy
This LinkedIn page is not staffed 24/7. Questions will be answered and posted comments shall be monitored only during regular business hours.

Comments, including but not limited to the following, may be deleted or edited by the moderators at their sole discretion:

-Off-topic and spam comments (this includes promotion or solicitation of events, groups, pages, Websites, organizations, products and programs not related to or affiliated with (business name);

-Comments that use foul language or "hate speech" (for example, including but not limited to racial, ethnic or gender bashing language);

- Anything unlawful, libelous, threatening, obscene, discriminatory or otherwise objectionable in ASN's sole discretion;

-Comments that violate the privacy of any individual;

-Comments that promote "witch-hunting" or "brigading" (A concentrated effort by one online group to manipulate another);

- Comments that infringes the copyright, trademark, patent, trade secret or other intellectual property rights of anyone;

- Comments or images containing nudity, or materials that may be considered obscene, lewd, excessively violent, harassing, explicit or otherwise objectionable; or,

-Any other comment or posting in ASN's sole discretion, undermines the purpose of the site or otherwise reflects unfavorably upon ASN's, its partners, affiliates or customers.
